pragma solidity ^0.7.6;

contract BinsERC20 is Ownable, ERC20 {
    using SafeMath for uint256;

    uint256 public tokenForMarketing = 800000 * 10**18;

    address public addressForMarketing;
    uint256 public sellFeeRate = 5;
    uint256 public buyFeeRate = 2;

    constructor(string memory name, string memory symbol) ERC20(name, symbol) {
        addressForMarketing = _msgSender();
    }

    function setTransferFeeRate(uint256 _sellFeeRate, uint256 _buyFeeRate)
        public
        onlyOwner
    {
        sellFeeRate = _sellFeeRate;
        buyFeeRate = _buyFeeRate;
    }

    function setMinTokensBeforeSwap(uint256 _tokenForMarketing)
        public
        onlyOwner
    {
        require(_tokenForMarketing < 20 * 10**6 * 10**18);
        tokenForMarketing = _tokenForMarketing;
    }
}

pragma solidity ^0.7.6;


contract BSocial is BinsERC20, ReentrancyGuard {
    using SafeMath for uint256;

    mapping(address => bool) bots;
    uint256 public maxSupply = 1000 * 10**6 * 10**18;

    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;

    bool public antiWhaleEnabled;
    uint256 public antiWhaleDuration = 15 minutes;
    uint256 public antiWhaleTime;
    uint256 public antiWhaleAmount;

    constructor(string memory name, string memory symbol)
        BinsERC20(name, symbol)
    {
        _mint(_msgSender(), maxSupply);
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
        );

        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
        .createPair(address(this), _uniswapV2Router.WETH());

        uniswapV2Router = _uniswapV2Router;
        _approve(address(this), address(uniswapV2Router), ~uint256(0));
    }

    function burn(uint256 amount) public {
        _burn(_msgSender(), amount);
    }

    function setWhales(address _bots) external onlyOwner {
        require(!bots[_bots]);

        bots[_bots] = true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        if (
            antiWhaleTime > block.timestamp &&
            amount > antiWhaleAmount &&
            bots[sender]
        ) {
            revert("Anti Whale");
        }

        uint256 transferFeeRate = recipient == uniswapV2Pair
            ? sellFeeRate
            : (sender == uniswapV2Pair ? buyFeeRate : 0);

        if (
            transferFeeRate > 0 &&
            sender != address(this) &&
            recipient != address(this)
        ) {
            uint256 _fee = amount.mul(transferFeeRate).div(100);
            super._transfer(sender, address(this), _fee); // TransferFee
            amount = amount.sub(_fee);
        }

        super._transfer(sender, recipient, amount);
    }

    function sweepTokenForMarketing() public nonReentrant {
        uint256 contractTokenBalance = balanceOf(address(this));
        if (contractTokenBalance >= tokenForMarketing) {
            swapTokensForEth(tokenForMarketing);
        }
    }

    // receive eth from uniswap swap
    receive() external payable {}

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            addressForMarketing, // The contract
            block.timestamp
        );
    }

    function setAddressForMarketing(address _addressForMarketing) external onlyOwner {
        require(_addressForMarketing != address(0), "0x is not accepted here");

        addressForMarketing = _addressForMarketing;
    }

    function antiWhale(uint256 amount) external onlyOwner {
        require(amount > 0, "not accept 0 value");
        require(!antiWhaleEnabled);

        antiWhaleAmount = amount;
        antiWhaleTime = block.timestamp.add(antiWhaleDuration);
        antiWhaleEnabled = true;
    }
}
